import{_ as o,W as n,X as s,Y as a,Z as e,$ as t}from"./framework-91490e6a.js";const l={},_=e("p",null,[e("code",null,"more"),t(" 这里是作者的的简单介绍")],-1),c=e("h1",{id:"关于作者",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#关于作者","aria-hidden":"true"},"#"),t(" 关于作者")],-1),r=e("p",null,"本人毕业于一所边缘院校，专业是软件工程，刚进入这个专业的时候，我甚至连这个专业是做什么的都不是很清楚，盲目的选择了一个自己并不熟悉的专业... 甚至有同学告诉我说，学校教的东西都不用学，只要拿到毕业证，学习一门编程语言就可以随便找工作，我当时甚至一度以为这是真的...",-1),d=e("p",null,"真正步入到这个行业也算是机缘巧合吧，在大二暑假的时候，不知道学什么的我，就去家乡兼职暑假工了。在这期间虽然我也不知道学什么， 但是我觉得我不能这么下去，于是我就开始在阿里云上自己找资源学习，从Linux到前端，没错，是从Linux到前端，在没有人指引的方向下， 学习的路线都是奇怪的......，后来开学后开始接触到Java，于是又开始学习Java的相关知识。",-1),u=e("p",null,"后来大四开始参加秋招，但是很不幸，那一年的秋招属实是有味道的，开局即是地狱级难度，千军万马过独木桥啊😭 😭，于是只能继续卷，卷到不能停。 但好在，在自己的坚持下，最后还是找到了一份工作，先积累下经验。",-1),i=e("p",null,"我第一家实习公司是一家中厂，后端开发，我在那里实习了5个月，从5月份到10月份。实习期间没人带，项目全部独立开发，mentor还经常pua我。 整整5个月，没请过一次假，交付给的任务也尽力去完成。为了转正，实习期间基本没投递简历，也错过了最佳的求职时间。 作为部门唯一实习生，没转正hc，只能跨部门转正完辩，国庆前答完辩，整整一个国庆没睡过一个好觉，总觉得自己答辩的时候表现得很差， 国庆之后的第二天leader告诉我转正没过，理由是主动性不够。那段时间整天焦虑的失眠，每天都在怀疑自己。 于是转正失败的第二天就从那家公司离职，后来我开始拼命地投递简历，PHP，销售，技服，C++，Java什么都投，有面试就接，也不管是实习还是秋招。 白天实习，晚上10到凌晨2点做笔试。 少时也有凌云志，而今识尽愁滋味。",-1),h=e("p",null,"在自己努力学习的过程中，说实话，这对我来说很不容易，家里并没有出过大学生，没有人能给我建议，更没有从事计算机行业的人， 我每走的一步都是自己慢慢摸索出来的，所以过程是真的很慢，而且学习的难度也很大。 一回想起自己曾经与室友学习到凌晨两点半，满满的心酸就好像要涌出来，向我们这种无人指引方向的人，能有今天这番，是真的很不容易的， 相信很多家庭条件并不优越，或者是无人指引的那种学生的人，感触或许会深一些吧。",-1),p=e("p",null,"这篇博客主要记录一些自己的学习经验和笔记，虽然对于我来说成为顶尖工程师还有超级远的路要走，但是希望还是有的，希望这篇博客可以见证自己的成功！ 我也把这篇博客命名为了成神之路，寓意自己将来也可以成为那样的人......",-1),m=e("p",null,[e("strong",null,"路依然遥远，尚不能停歇！")],-1);function f(x,v){return n(),s("div",null,[_,a(" more "),c,r,d,u,i,h,p,m])}const B=o(l,[["render",f],["__file","about-me.html.vue"]]);export{B as default};
